import React from 'react';
import './App.css';
import Nav from './components/nav';
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import Home from './screens/Home';
import EscolhaNome from './screens/EscolhaNome';


function App() {
  return (
    <div className="App">	
		<Router>
			<Nav />	
			<main>
				<Routes>
					<Route path='/Home' element={<Home />} />
					<Route path='/EscolhaNome' element={<EscolhaNome />} />
				</Routes>
			</main>		
		</Router>	
	</div>

  );
}

export default App;
